import "./reserveTutorscr.css"


import { useState, useEffect } from "react";
import axios from "axios";

function ReserveTutorPage() {
  const [reservations, setReservations] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios.get("https://x4g0ddpp1f.execute-api.us-east-2.amazonaws.com/prod/show/reservations");
      setReservations(response.data.body);
    };
    fetchData();
  }, []);

  return (
    <div className="container">
      <h1>Reservations</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Date</th>
            <th>First Name</th>
            <th>Time</th>
          </tr>
        </thead>
        <tbody>
          {reservations.map((reservation) => (
            <tr key={reservation.id}>
              <td>{reservation.tutor_name}</td>
              <td>{reservation.student_name}</td>
              <td>{reservation.date}</td>
              <td>{reservation.time}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ReserveTutorPage;
